          Num_Processo: 20793,
          Minima_Processo: 0.00,
          Media_Processo: 35.59,
          Maxima_Processo: 498.59,
          Num_Eventos:160689 ,
          Minima_Evento:3,
          Media_Evento: '7.75',
          Maxima_Evento:34,
        }
      );
}


export default (props)=>
<div style={{padding:10,borderRadius:10}}>
